style.css:
@-moz-document url-prefix("https://med.firecracker.me") {
.examTaker-main .examTaker-content {
    background-color: #17274b;
    color:#FFEAC1;
}
.examTaker-question-description .highlight {
    background-color:#fff2a8;
    color: #000;
}
.qoList-item.-current {
    cursor:default;
    background-color:#5d87f0;
}
.qoList-item:nth-child(even):not(.-current) {
    background-color:#1b2337;
    color: #FFEAC1;
}
.qoList-item:hover, .qoList-item:link, .qoList-item:visited {
    color:#FFEAC1;
    background-color: #2a3c66;
}
.examTaker-sidebar, html {
    overflow-y:scroll;
    scrollbar-width: thin;
    scrollbar-color: #90A4AE #CFD8DC;
    background-color: #17274b;
}
.raph-examTakerAnswers:not(.-answerChoicesAreDisabled) .raph-examTakerAnswers-answer:hover {
    background-color:#464FD7;
}
.raph-examTakerAnswers-answer.-isCorrect {
    border:1px solid #090;
    background-color:#0C990C;
}
.route-sessionsSessionBlockTake .raph-examTakerExplanations-incorrectExplanations-title {
    color: #260e0e;
}
.layoutDefault-content {
    min-height:100vh;
    padding-bottom:8px;
    background-color:#17274b;
    font-weight: 600;
    color:#FFEAC1;
}
.sessionReview .sessionReview-header, .sessionReview-header .sessionReview-header-item {
    background-color: #2d51a2;
}
.sessionReview-content-title {
    color:#ff0af0;
}
.sessionReview-tabsList .sessionReview-tabsList-tab:not(:last-child) {
    color: #1ae443;
}
.sessionReview-tabsList .sessionReview-tabsList-tab:not(.active) {
    color: #1ae443;
}
.sessionReview-comparativeStatsContainer, .sessionReview-tabsList .sessionReview-tabsList-tab.active {
    color: #1ae443;
}
.raph-refreshQuestionsDialog-title {
    color:#ff0af0;
}
.raph-refreshQuestionsDialog-controls .raph-refreshQuestionsDialog-selected {
    color: #ff0af0;
}
.sessionReview-questionsCorrect-description-item _incorrect {
    color:#fff;
}
.raph-donut-foreground {
    background-color:#a5bbec;
}
.raph-completedInOn-item {
    color:#ebfaf0;
}
.raph-completedInOn-icon, .raph-completedInOn-icon .raph-svg-fill {
    fill:#ebfaf0;
}
.sessionReview-answers-row._title {
    color:#ebfaf0;
}
.sessionReview-answers-row-column._number {
    color:#ebfaf0;
}
.sessionReview-questionsCorrect-description-item._incorrect {
    color: #e82e48;
}
.sessionReview-questionsCorrect-description-item._unanswered {
    color:#b1b1b1;
}
.sessionReview-questionsCorrect-numbers .sessionReview-questionsCorrect-numbers-label {
    color: #000;
}
.to-do--tab__view {
    background: #17274b;
}
.review--details {
    background: #17274b;
    color: #FFEAC1;
}
.fc-body {
    background: #17274b;
}
h2, h3, p {
    color: #FFEAC1;
}
.box, .high-yield-box {
    border: unset;
    background: #17274b;
}
.circle-graph__multiple .circle-graph--wrapper .circle-graph--white {
    background-color: #17274b;
    color: #FFEAC1;
}
.footer {
    height: 0;
}
.tree-todos-route {
    background: #17274b;
}
.to-do--list {
    background: #17274b;
}
.current-refresh-tasks-section-header._title {
    color: #FFEAC1;
}
.quiz-progress-bar .filler-background, .quiz-progress-bar-incomplete {
    background: rgba(109, 7, 255, 0.79);
}
.to-do--tasks h2 {
    color: #FFEAC1;
}
.taskListHeader-title {
    color: #FFEAC1;
}
.to-do--tasks .to-do--info__subject-name {
    font-size: 12px;
    color: #1eeca8;
}
.to-do__list-tabs {
    background: #17274b;
    border-bottom: 3px solid #13adbd;
    border-bottom-color: rgb(19, 173, 189);
    border-bottom-style: solid;
    border-bottom-width: 3px;
    color: #FFEAC1 !important;
}
.questionReview-dailyCvContainer {
    background-color: #170038;
}
.dailyCvContainer-footer {
    background-color: #170038;
}
.dailyCvContainer-content-inner {
    background-color: #17274b;
    border: unset;
    color: #FFEAC1;
}
.dailyCvContainer-question-q {
    color: #FFEAC1;
}
.dailyCvContainer .dailyCvContainer-content {
    background-color: #17274b;
    border: 1px solid #02FFFF;
}
.dailyCvContainer-question-copy {
    line-height: 1.5;
    color: #FFEAC1;
}
.dailyCvContainer-answer-content {
    color: #FFEAC1;
}
.topicBreadcrumbs, .topicBreadcrumbs a {
    color: #FFEAC1;
}
input, textarea, .page-tree-index, .toPic-name, .study-something__content, .product-nav, .product-nav .field-select__dropdown, .product-nav .field-select__dropdown select, .study-something__product-overview, .answer-text, .content, .fc-modal__box .has-icon, h3 {
    color: #FFEAC1;
    background-color: #17274b;
}
.form-group {
    margin-bottom: 15px;
    color: #FFEAC1;
}
.quiz-answer-column {
    background-color: #1b2337;
}
.form-basic__row--left, .form-basic__row.legend, .legend.form-basic__row--buttons, .legend.form-basic__row--input, .form-basic__row.legend .form-basic__row--left, .legend.form-basic__row--buttons .form-basic__row--left, .legend.form-basic__row--input .form-basic__row--left, .form-basic__row--left {
    text-align: left;
    color: #FFEAC1;
}
.question-text, .question-text p, a {
    position: relative;
    color: #FFEAC1;
}
.form-basic__row--left, .form-basic__row.legend, .legend.form-basic__row--buttons, .legend.form-basic__row--input, .form-basic__row.legend .form-basic__row--left, .legend.form-basic__row--buttons .form-basic__row--left, .legend.form-basic__row--input .form-basic__row--left, .form-basic__row--left {
    text-align: left;
    color: #FFEAC1;
    background: #1b2337;
}
.quiz-scroll {
    background: #1b2337;
}
.form-basic__actions {
    padding: 24px;
    text-align: center;
    background: #1b2337;
}
.content-tree__node-content a.content-tree__node-title {
    color: #FFEAC1;
}
.content-tree__node-wrapper.sub_subject, .content-tree__node-wrapper.subject, .content-tree__node-wrapper.topic {
    background-color: #223560;
}
.product-nav {
    border-top:unset;
    border-bottom:unset;
}
.study-something__nav {
    border-right: unset;
    background: #17274B;
}
.content-tree__node.subject {
    border-top: unset;
    border-bottom: unset;
    background: unset;
}
.content-tree__node-list.sub_subject, .content-tree__node-list.subject {
    border-top: 1px solid #1ddf96;
    border-bottom: 1px solid #1ddf96;
    border-left: 1px solid #1ddf96;
    background: #157CD7;
}
.content-tree__percent-marked span {
    background: #1ed6df;
    border: unset;
    color: #240553;
}
.raph-studentCourseListItem-column .raph-studentCourseListItem-column-title, .raph-studentCourseListItem-statLabel {
    color: #FFEAC1;
}
.raph-studentCourseEffortBar-segment._otherMarked {
    background: #5e76f4;
}
.raph-studentCourseListItem {
    border: unset;
    background: #1B2337;
}
.form-basic__row, .form-basic__row--buttons, .form-basic__row--input {
    background: #1b2337;
    border-top: unset;
    border-bottom: unset;
}
content-tree__node.sub_subject, .content-tree__node.topic {
    border-top: unset;
}
.mark svg path {
    stroke: #163bce;
    stroke-width: 1px;
    fill: #1ed6df;
}
.createRefreshDailyCv-item.incorrect {
    color: #FFEAC1;
}
h1, .dailyCvAheadFinishMessage__additionalText {
    color: #FFEAC1;
}
.dailyCvFinishMessage-box {
    background-color: #1B2337;
    border: 1px solid #1B2337;
    border-radius: 6px;
}
.dailyCvAheadFinishMessage-content {
    background: #26314D;
    color: #fffaf0;
}
.dailyCvContainer-answer .dailyCvContainer-answer-explanation {
    color: #FFEAC1;
}
.dailyCvContainer-answer .dailyCvContainer-answer-status {
    color: #30ffe2;
}
.dailyCvContainer-answer-letter {
    border: 2px solid #02FFFF;
    border-radius: 50%;
    color: #02FFFF;
    background-color: #170038;
}
.dailyCvContainer-labValues {
    background: unset;
}
}
